"282ea251bdfda29ddf988b813e77ebb65c7d6c0d":"That's it, now you have a complete trade block with its options. It's time to define a strategy","061c155afc9f43271499f20bcce319696f4aa313":"This is a <b>Strategy</b> block. All the blocks you put in here are run for each and every tick received.","696c77bbfeb462218ecc62ad7c3cb026357d14d2":"The received tick value is in the block <b>tick</b> and the tick direction (up or down) is in the block <b>direction</b>. You can pick them from the <b>Strategy</b> menu",a4fda48ca1d26066926c0c7c007036585e797626:"For this tutorial we are not going to use those blocks, so we create our strategy by adding a <b>purchase</b> block. Please pick a purchase block","40cb4329c38e75111dfcf1c3a7d53f9ec44f63d2":"Now add it to the Strategy block.",d28ef98e1110ce8a06df4b2d42eae6c07990ae7b:"Nicely Done! The purchase block initiates a purchase defined by its dropdown list, e.g. if your condition block is of <b>Up/Down</b> type you will have <b>Up</b> and <b>Down</b> options on the purchase block to select from.","039b5485ec321d83859b48fc91bf895e52429312":"A Strategy block consisting of only a purchase block means to purchase as soon as the first tick was received.",a43189bbd3610654b30c9e287b7a8285c72f06ed:"After a purchase was started, the bot waits till the purchase is completed, and then gives the control to the <b>On Finish</b> block","2eb458fc248cf538e898779cd4814e28af5db24b":"Same as the Strategy block, the <b>On Finish</b> block can have multiple blocks defining its functionality. The On Finish block defines what to do when the previously purchased contract is finished.","0ecb627b112c26389825381d5280f557345ab194":"A <b>Trade Again</b> block creates a new trade and exits from the On Finish block. Now pick a Trade Again block.","6d08f40f24b29cd87eaf796ece4852012ac1a76c":"Now add it to the On Finish block","9f243ff5d65e374ceadc4d4521c541c828fee8b4":"Excellent! The <b>Trade Again</b> block starts a new trade immediately after the previous contract is finished, therefore creates an infinite loop which goes on and on until the Trade Again block isn't called e.g. in a logic block which its condition is unmet.","5670fb9533116ca78adec7a1bb8bc2f77212bf73":"OK, that's it. Now we have a working bot which buys a contract after the first tick and then creates another trade which is exactly the same as before.",d4ab4221f6388023bec13302714e98a84bbfb4c9:"If you changed a block by accident you can always undo/redo your changes using these buttons or Ctrl+Z for undo and Ctrl+Shift+Z for redo","23b3d90128fcabe7e299fb6f8301e6f2a4a7f477":"You can save your blocks using this button",ce0325bbe958c5dd7729d29a798484ca9a5a063f:"You can load your blocks using these tools",fda3db9f6403aa2eb92dd93ce7ff60503aa4f7c0:"At last! It's time to run the blocks we created. You can run/stop the blocks by clicking on the run/stop buttons in this menu. Please make sure you have chosen a Virtual Account before running the blocks.","837730f3669584a070e3252eccf39aa0b96d3820":"You can choose the token you want by the <b>Account</b> dropdown on the trade block. If you do not have any token in the dropdown please login using the <b>Login</b> button above. Please make sure to use Virtual Account tokens for testing.","291a075899eea8a2c208834bebacd0eb4add67c3":"You can add a token to the bot using the <b>Add Token</b> button.","803adad740b5756a975629ac142e7f520af7303e":"You can see the summary of your trades in this menu.","529d9fa8f773d3164f19697eebca2627b451d26a":"Go ahead and run the blocks. You can stop the code anytime you want using the stop button","362ade1b08d481c8c83c5dbc63866c81b4706814":"Welcome to the binary bot, a blockly based automation tool for binary.com trades. If you want to skip this tutorial click on the <b>Stop!</b> button at the top right of the page.",ec58d9b45b6d9d2873a67648e21affc43d4108bc:"The blocks you put in here will create a binary bot code which you can then execute using the run button.",de35db98b87ad43d4e07602143a43514a2a0c